import React from 'react';
import './navigation.styles.scss';

const Navigation = () => {
  return (
    <div className="puppy-culture">
      <section className="get-started">Get Started</section>
      <section className="shop">Shop</section>
      <section className="useful-information">Useful Information</section>
      <section className="about">About</section>
    </div>
  );
};

export default Navigation;
